import styled from 'styled-components'

export const Wrapper = styled.div`
  position: relative;
  width: 100vw;
  height: 100%;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
`

export const Content = styled.div`
  width: 50px;
  /* display: flex; */
  position: relative;
  flex: 1 0 auto;
`
